        setRight(Right + 1);
    }
    const LeftClick = () => {
        setLeft(Left+1);
    }
    return(
        <div>
            {Left}
            {Right}
            <button onClick={LeftClick}>Left</button>
            <button onClick={RightClick}>Right</button>
        </div>

    )


}

export default App;
